import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

//import Players from './players';
import Contest from './contest';
import React from "react"
import Matches from "./batball.js"
import Preview from "./previewpage.js"
import Players  from './players';
//import Duration from "./duration.js"
import Team from "./team"
import Register from "./Register.js"
import Home from "./Home.js"


 export default function App (){
  let user={name:"BluffMaster",profile:"arjunreddy.jpg" ,balance:500,team:[],totalpoints:0,
  calculatepoints:function (){
    if(this.team.length===0){
      this.totalpoints=0;
    }
    else{
       this.totalpoints= this.team.reduce((accumulator,item)=>{
          return accumulator+item.currentpoints;

        },0)
        return this.totalpoints;



      }}

      }
  let props={spots:4,entryfee:49,user};

  return (
    <Router>
      <Routes>
        <switch>
      <Route path='/register' element={<Register/>}></Route>
        <Route path="/" element={<Home></Home>}/>

        <Route path='/matches' element={<Matches/>}/>
        <Route path="/players" element={<Players user={user} />}/>
        <Route path="/contest" element={<Contest props={props} />} />
        <Route path="/preview" element={<Preview/>}/>
        <Route path='/team' element={<Team></Team>}></Route>
        </switch>

      </Routes>
    </Router>
  );
  };
